import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {

  let today = new Date();
  console.log(`Current time is ${today.getUTCHours()}:${today.getUTCMinutes()}, ${today.getUTC}`);
  let estHours = today.getUTCHours()-4;
  let currentTimeEST;
  if (estHours > 12) {
    currentTimeEST = `${estHours-12}:${today.getUTCMinutes()} PM`;
  } else {
    currentTimeEST = `${estHours}:${today.getUTCMinutes()} AM`;
  }
  console.log(currentTimeEST);


  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Current time is {today}
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
